selector_to_html = {"a[href=\"glossary.html#term-Compiler\"]": "<dt id=\"term-Compiler\">Compiler</dt><dd><p>The part of a C++ implementation that produces object code from a translation unit. More generally compilers transform source code into other types of code, but most often into native machine code that is interpreted directly by the <a class=\"reference internal\" href=\"#term-CPU\"><span class=\"xref std std-term\">CPU</span></a>.</p></dd>", "a[href=\"glossary.html#term-Assignment\"]": "<dt id=\"term-Assignment\">Assignment</dt><dd><p>DEf</p></dd>", "a[href=\"glossary.html#term-Copy-Assignment\"]": "<dt id=\"term-Copy-Assignment\">Copy Assignment</dt><dd><p>Replacement of the contents of one object with the contents of a second object; the second object is unaffected by the operation. Can also intitialise an object.</p></dd>", "a[href=\"#unspecified-behaiours\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Unspecified Behaiours<a class=\"headerlink\" href=\"#unspecified-behaiours\" title=\"Permalink to this heading\">#</a></h2><p>The behaviour of every part of your code must operate in the way you expect it to, or unexpected outcomes will result.</p><p>Unspecified behaviours are those which may vary between implementations, and which the implementation is not required to document.</p>", "a[href=\"#ternary-operators\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ternary Operators<a class=\"headerlink\" href=\"#ternary-operators\" title=\"Permalink to this heading\">#</a></h2><p>Example:\n<code class=\"docutils literal notranslate\"><span class=\"pre\">return</span> <span class=\"pre\">(a</span> <span class=\"pre\">&gt;=</span> <span class=\"pre\">b)</span> <span class=\"pre\">?</span> <span class=\"pre\">a</span> <span class=\"pre\">:</span> <span class=\"pre\">b;</span></code></p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">?</span></code> construct is called an \u2018arithmetic if\u2019 or a conditional expression.\nThe returned value will be a if the condition is true and b if the condition is false.\nvalue of (a &gt;= b) ? a : b is a if a &gt;= b and b otherwise.\nThat is, if the condition is true, the ternary operator value a if true, otherwise value b.</p>", "a[href=\"#operations-and-operators\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Operations and Operators<a class=\"headerlink\" href=\"#operations-and-operators\" title=\"Permalink to this heading\">#</a></h1><h2>Expressions<a class=\"headerlink\" href=\"#expressions\" title=\"Permalink to this heading\">#</a></h2><p>An expression is a sequence of operators and their operands, that specifies a computation.</p><p>Expression evaluation may produce a result (e.g., evaluation of 2 + 2 produces the result 4) and may generate side-effects (e.g. evaluation of std::printf(\u201c%d\u201d, 4) prints the character \u20184\u2019 on the standard output).</p>", "a[href=\"#useful-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Useful functions<a class=\"headerlink\" href=\"#useful-functions\" title=\"Permalink to this heading\">#</a></h2><p>std::max(7,8)\nstd::abs(a)</p>", "a[href=\"#examplek1\"]": "<div class=\"example dropdown admonition\" id=\"examplek1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">example 18 </span> (Example)</p>\n<section id=\"example-content\">\n<p>Complete and run the following code:</p>\n<div class=\"highlight-c++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">count</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Please enter a number followed by your surname.</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">count</span><span class=\"p\">;</span><span class=\"w\"> </span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">c2</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">count</span><span class=\"w\"> </span><span class=\"o\">+</span><span class=\"w\"> </span><span class=\"mi\">2</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">motivator</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"s\">\"Dr.\"</span><span class=\"w\"> </span><span class=\"o\">+</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Study \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">c2</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\" times harder \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">motivator</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"!</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span><span class=\"w\">\u00a0</span>\n</pre></div>\n</div>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Write</span><span class=\"w\"> </span><span class=\"n\">code</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">..</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"exercise dropdown admonition\" id=\"jupyternotebooks/operations_and_operators-exercise-1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 14 </span></p>\n<section id=\"exercise-content\">\n<p>Try moving the declaration of name to after</p>\n</section>\n</div>\n<div class=\"explanation dropdown tip admonition\" id=\"explanationk1\">\n<p class=\"admonition-title\">Explanation of<a class=\"reference internal\" href=\"#examplek1\"> Code Example 18 (Example)</a></p>\n<section id=\"explanation-content\">\n</section>\n</div>\n</section>\n</div>", "a[href=\"#exercisek2\"]": "<div class=\"exercise dropdown admonition\" id=\"exercisek2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 15 </span></p>\n<section id=\"exercise-content\">\n<p>Complete this code using the ternary operator to print out the name of the enemy that is closest.</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;string&gt;</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t</span><span class=\"k\">while</span><span class=\"w\"> </span><span class=\"p\">(</span><span class=\"nb\">true</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">city1</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Enter the name of city 1...\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">city1</span><span class=\"p\">;</span><span class=\"w\"> </span>\n<span class=\"w\">\t\t</span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">dist1</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Enter the distance to city 1 from Glasgow...\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">dist1</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">city2</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Enter the name of city 1...\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">city2</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">dist2</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Enter the distance to city 1 from Glasgow...\"</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cin</span><span class=\"w\"> </span><span class=\"o\">&gt;&gt;</span><span class=\"w\"> </span><span class=\"n\">dist2</span><span class=\"p\">;</span>\n<span class=\"w\">\t\t</span>\n<span class=\"w\">\t</span><span class=\"p\">}</span>\n<span class=\"w\">\t</span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"solution dropdown note admonition\" id=\"solutionk2\">\n<p class=\"admonition-title\">Solution to<a class=\"reference internal\" href=\"#exercisek2\"> Exercise 15</a></p>\n<section id=\"solution-content\">\n<div class=\"highlight-c++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"w\">\t\t</span><span class=\"p\">(</span><span class=\"n\">dist2</span><span class=\"w\"> </span><span class=\"o\">&lt;</span><span class=\"w\"> </span><span class=\"n\">dist1</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"o\">?</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"City 2 </span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"City 1 </span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n</pre></div>\n</div>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#assignment-operators\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Assignment operators<a class=\"headerlink\" href=\"#assignment-operators\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference internal\" href=\"glossary.html#term-Assignment\"><span class=\"xref std std-term\">Assignment</span></a> operators modify the value of an object.</p><p><a class=\"reference internal\" href=\"glossary.html#term-Copy-Assignment\"><span class=\"xref std std-term\">Copy Assignment</span></a> replace the contents of an object (often a value) with the contents of a second object.</p>", "a[href=\"#order-of-evaluation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Order of evaluation<a class=\"headerlink\" href=\"#order-of-evaluation\" title=\"Permalink to this heading\">#</a></h2><p>The order of evaluation of any part of any expression, including the order of evaluation of function arguments, is usually unspecified.</p><p>The <a class=\"reference internal\" href=\"glossary.html#term-Compiler\"><span class=\"xref std std-term\">compiler</span></a> can evaluate operands and other subexpressions in any order, and may choose another order when the same expression is evaluated again.</p>", "a[href=\"glossary.html#term-Type\"]": "<dt id=\"term-Type\">Type</dt><dd><p>A type defines the proper use of a name or an expression.</p></dd>", "a[href=\"#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Operations and Operators<a class=\"headerlink\" href=\"#id1\" title=\"Permalink to this heading\">#</a></h2><p>Each <a class=\"reference internal\" href=\"glossary.html#term-Type\"><span class=\"xref std std-term\">type</span></a> can be operated on by specific operators</p><p>Some operators are overloaded - <code class=\"docutils literal notranslate\"><span class=\"pre\">+</span></code> is the addition operator for arithmetic types, but the <a class=\"reference internal\" href=\"glossary.html#term-Concatenation\"><span class=\"xref std std-term\">concatenation</span></a> operator for <code class=\"docutils literal notranslate\"><span class=\"pre\">string</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">char</span></code> types.</p>", "a[href=\"glossary.html#term-Concatenation\"]": "<dt id=\"term-Concatenation\">Concatenation</dt><dd><p>Joining of two strings together.</p></dd>", "a[href=\"#expressions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Expressions<a class=\"headerlink\" href=\"#expressions\" title=\"Permalink to this heading\">#</a></h2><p>An expression is a sequence of operators and their operands, that specifies a computation.</p><p>Expression evaluation may produce a result (e.g., evaluation of 2 + 2 produces the result 4) and may generate side-effects (e.g. evaluation of std::printf(\u201c%d\u201d, 4) prints the character \u20184\u2019 on the standard output).</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 0],

            });
        };
    };
    console.log("tippy tips loaded!");
};
